syntax = "proto3";

package tinder.events.model.app.hubble.details;

import "google/protobuf/wrappers.proto";

option java_multiple_files = true;
option java_package = "com.tinder.generated.events.model.app.hubble.details";

message NetworkRequestDetails {
    google.protobuf.StringValue path = 1;
    google.protobuf.StringValue http_method_type = 2;
    google.protobuf.StringValue url = 3;
    google.protobuf.StringValue endpoint = 4;
}
